import {Types} from '../actions/dow';


export default function dowReducer(state =  INITIAL_STATE, action){
  switch (action.type){
    case Types.GET_DOW_SUCCESS:{
      // console.log('successful dowReducer call')
      // console.log(action.payload)
      return {
        ...state,
        data:action.payload
      }
    }
    default:
      return state;
  }
}
